# coding=utf-8

text='abcdefghijklmnopqrstuvwxyz'

def vigneer(message,key):
	# cryptotext = ""
	# for i,x in enumerate(message):
	# 	cryptotext += text[(text.index(x)+text.index(key[i % len(key)]))%26]
	# return cryptotext

	return "".join([text[(text.index(x) + text.index(key[i % len(key)]))%26] for i,x in enumerate(message)])

def decode_vigneer(cryptotext,key):
	return "".join([text[(text.index(x) - text.index(key[i % len(key)]))%26] for i,x in enumerate(cryptotext)])

